import React from 'react';
import classes from './dialog.module.css';
import Dialogs from "./dialog/dialogs";
import Chat from "./chat/chat";

const Dialog = (props)=>
{
    return(
        <div className={classes.content}>
            <Dialogs/>
            <Dialogs/>
            {/*<Chat/>*/}
        </div>
    );
}
export default Dialog;
